import React from 'react';

function ExampleCarouselImage({ text }) {
  return (
    <div style={{ height: '400px', backgroundColor: '#ccc', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <h2>{text}</h2>
    </div>
  );
}

export default ExampleCarouselImage;
